import React from "react";
import {
  SideBarContainer,
  Icon,
  CloseIcon,
  SideBarWrapper,
  SideBarMenu,
  SideBarLink,
} from "./styling/Sidebar.styled";

const Sidebar = () => {
  return (
    <SideBarContainer>
      <Icon>
        <CloseIcon />
      </Icon>
      <SideBarWrapper>
        <SideBarMenu>
          <SideBarLink>Home</SideBarLink>
          <SideBarLink>Services</SideBarLink>
          <SideBarLink>About Us</SideBarLink>
          <SideBarLink>Contact</SideBarLink>
        </SideBarMenu>
      </SideBarWrapper>
    </SideBarContainer>
  );
};

export default Sidebar;
